definitions.definition:
Of or pertaining to three miles; as, the three-mile limit, or the limit of the marine belt (the 
               three-mile beltorthree-mile zone
            ) of three miles included in territorial waters (which see) of a state.

A telegraphic receiving instrument that automatically prints off stock quotations (
               stock ticker
            ), market report, or other news on a paper ribbon or “tape.”

A game resembling bagatelle, played on a special oblong board or table (
            Tivoli boardorTivoli table
         ), which has a curved upper end, a set of numbered compartments at the lower end, side alleys, and the surface studded with pins and sometimes furnished with numbered depressions or cups.
